import React, { Component } from 'react';
import axios from 'axios';

export default class createContent extends Component {
  state = {
    queuename: 'user',
    payload: 'sent from react',
  };

  setDefaultState = () => {
    this.setState({
      queuename: 'user',
      payload: 'sent from react',
    });
  };
  handleChange = (e) => {
    const target = e.target;
    const name = target.name;
    const value = target.value;

    this.setState({
      [name]: value,
    });
  };
  onSubmit(e) {
    e.preventDefault();
    const obj = {
      queuename: 'user',
      payload: 'sent from react',
    };
    axios
      .post('http://localhost:8000/post/msg', obj)
      .then((res) => console.log(res.data));
  }

  render() {
    console.log('state:', this.state);
    return (
      <div style={{ marginTop: 10 }} className="heading-list">
        <form onSubmit={this.onSubmit}>
          <div className="form-group">
            <input
              defaultValue={this.state.queuename || 'user'}
              onChange={this.handleChange}
              name="queuename"
            />
            <input
              defaultValue={this.state.payload || 'sent from react'}
              name="payload"
              onChange={this.handleChange}
            />
            <input type="submit" value="Submit" />
          </div>
        </form>
      </div>
    );
  }
}
